import React from 'react';
import { Box, Button, Text, Grommet, Paragraph} from 'grommet';
import { Search as SearchIcon, Hpe, Menu } from 'grommet-icons';


function App() {

  const theme = {
    global: {
      colors: {
        brand: '#01A982',
      },
      font: {
        family: 'Roboto',
        size: '18px',
        height: '20px',
      },
    },
  };

  const AppBar = (props) => (
      <Box
        tag='header'
        direction='row'
        align='center'
        justify='between'
        background='brand'
        pad={{ left: 'medium', right: 'small', vertical: 'small' }}
        elevation='medium'
        style={{ zIndex: '1' }}
        {...props}
      />
    );

  return (
    <Grommet theme={theme}>
      <AppBar>
        <Box direction="row" align="start" gap="small" pad={{ vertical: 'small' }} >
          <Hpe color="white" />
            <Box direction="row" gap="xsmall" wrap>
              <Text color="text-strong" weight="bold">HPE</Text>
              <Paragraph>Console</Paragraph>
            </Box>
        </Box>
        <Button icon={<SearchIcon />} onClick={() => {}} />
      </AppBar>


    </Grommet>
  );
}

export default App;
